<script lang="ts">
	import { goto } from '$app/navigation';
	import { account } from '$lib';
	import { onMount } from 'svelte';

	onMount(() => {
		setTimeout(() => {
			showDialog();
		}, 5000);
	});

	function showDialog() {
		dialog.showModal();
	}

	async function signOut() {
		try {
			await account.deleteSession('current');
		} catch (err) {
			console.log(err);
		} finally {
			goto('/');
		}
	}

	async function extendSession() {
		try {
			await account.get();
			dialog.close();

			setTimeout(() => {
				showDialog();
			}, 5000);
		} catch (err) {
			console.log(err);
			goto('/');
		}
	}

	let dialog: any;
</script>

